window.bookSummaryJSON = "<p>Thomas always enjoyed kingdom/city simulation games. When he discovers there is a kingdom building expansion to the hugely popular VRMMORPG Lewd Saga, he is determined to join the sensual fantasy game and build his destiny.</p> <p>Thomas becomes Edric Temple, summoner and adventurer, searching for others to help build a kingdom while a war rages across all of Lukken.</p> <p>The player slowly realizes Lewd Saga is more than just a fantasy game. Dark plots, torn hearts, and medieval politics will place the young summoner in the eye of the storm between guilds, troll masters and what his heart truly desires.</p> <p>Can Edric keep his new friends and fledgling kingdom together as the forces of darkness threaten to destroy everything they created?</p> <p>Lewd Saga is a Virtual MMORPG, based in the fantasy world of Lukken, home of dragon royalty, human kingdoms, and troll masters. Players quest, grow their abilities, join in great battles and find love and lust in whatever form they desire. There is no taboo too great or too intimate.</p> <p>Warning: The tale you are about to listen to is a story of sexual creatures, human or otherwise. This tale is for adults 18 and up. </p>"; 
